import Profile from "./components/Profile.js";
const profile =[{ name: "Geo", age: 18 },{ name: "Tom", age: 25 }, { name: "Lisa", age: 21 }]

const Example = () => {
  return (
    <>
      <h3>練習問題</h3>
      <p>Profileコンポーネントを使用して、完成コードと同じ画面を作成してください。</p>
      <p>また、Profileコンポーネント内のリスト表示部分にkeyを設定して、ワーニング表示がされないようにしてください。</p>
      <ul>
        <Profile 
         name={profile[0].name}
         age={profile[0].age}
         Hobby={""}
         name1={profile[1].name}
         age1={profile[1].age}
         Hobby1={""}
         name2={profile[2].name}
         age2={profile[2].age}
         Hobby2={""}
        />
      </ul>
    </>
  );
};

export default Example;
